import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header"></header>
    </div>
  );
}

function States() {
  return (
    <div>
      <p>California</p>
      <p>Texas</p>
    </div>
  );
}

export default App;
